from typing import List
import queue
from collections import deque
class Solution_old:
    def padding(self,grid:List[List[str]])->List[List[str]]:
        row,col=len(grid)+2,len(grid[0])+2
        new_grid=[['0']*col for i in range(row)]
        for i in range(1,row-1):
            for j in range(1,col-1):
                new_grid[i][j]=grid[i-1][j-1]
        return new_grid

    def numIslands(self, grid: List[List[str]]) -> int:
        grid=self.padding(grid)
        row,col=len(grid),len(grid[0])
        all_lands=[(i,j) for i in range(len(grid)) for j in range(len(grid[0])) if grid[i][j]=='1']
        num_islands=0
        while len(all_lands)!=0:
            print(len(all_lands))
            num_islands=num_islands+1
            cur_eles=[all_lands.pop()]
            while len(cur_eles)!=0:
                i,j=cur_eles.pop()
                if (i-1,j) in all_lands:
                    all_lands.remove((i-1,j))
                    cur_eles.append((i-1,j))
                if (i+1,j) in all_lands:
                    all_lands.remove((i+1,j))
                    cur_eles.append((i+1,j))
                if (i,j-1) in all_lands:
                    all_lands.remove((i,j-1))
                    cur_eles.append((i,j-1))
                if (i,j+1) in all_lands:
                    all_lands.remove((i,j+1))
                    cur_eles.append((i,j+1))
        return num_islands

#deque is soooooo much faster....
class Solution:
    # @param grid, a list of list of characters
    # @return an integer
    def numIslands(self, grid):
        if not grid:
            return 0
        lands=set([(i,j) for j in range(len(grid[0])) for i in range(len(grid)) if grid[i][j]=='1'])
        count=0
        while lands:
            print(len(lands))
            count+=1
            i,j=lands.pop()
            connected=deque()
            connected.append((i,j))
            while connected:
                i,j=connected.popleft()
                if (i+1,j) in lands:
                    connected.append((i+1,j))
                    lands.remove((i+1,j))
                if (i-1,j) in lands:
                    connected.append((i-1,j))
                    lands.remove((i-1,j))
                if (i,j+1) in lands:
                    connected.append((i,j+1))
                    lands.remove((i,j+1))
                if (i,j-1) in lands:
                    connected.append((i,j-1))
                    lands.remove((i,j-1))
        return count


